  \"Six-Axis Force-Torque Transducer for Mars 2018 Mission Project\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 1,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-07T03:46:57.414229\",\n\t\"name\": \"six-axis-force-torque-transducer-for-mars-2018-mission-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"A transducer element that is hearty enough
  for a Mars lander mission needs to be developed so that a six-axis force and torque
  transducer is possible.rnrnThe technical objectives are:rn1. A transducer element
  capable of surviving temperatures from -135?C to +125?C.rn2. The transducer element
  in objective 1 with temperature compensation to minimize span and offset drift from
  -80?C to +70?C.rn3. The transducer element in objective 2 constructed so that it
  will sense properly in an atmospheric vacuum of 1E-5 torr.rn4. The transducer element
  in objective 3 made of low-outgassing materials that are compatible with an interplanetary
  sample-collecting mission.rn5. The transducer element in objective 4 instrumented
  with redundant sets of strain gages.rnrnIn order to achieve the objectives, ATI
  Industrial Automation has divided the project into these tasks:rn* Six degree of
  freedom transducer design and fabrication,rn* Load fixture design and fabrication,rn*
  Instrumentation and temperature compensation of transducersrn  - using semiconductor
  strain gages andrn  - using metal-foil strain gages,rn* Calibration of instrumented
  beams and redundant instrumentation,rn* Performance characterization of both transducer
  instrumentation types at temperature and vacuum.\",\n\t\"license_title\": \"U.S.
